import React, { useState } from 'react'
import UploadForm from './components/UploadForm';
import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<UploadForm />} />
        <Route path="/result/:filename" element={<ResultPage />} />
      </Routes>
    </Router>
  );
}

export default App;
